package bookmark;

public class BookmarkInfo {
	private String classcode;
	private String status;
	private String nickname;
	private String info;
	private String history;
	private String title;
	private String sns;
	private String category;
	private String ftf;
	private String loc;
	private String price;
	private String classtime;
	private String formimg;
	private String profile;
	public BookmarkInfo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public BookmarkInfo(String classcode, String status, String nickname, String info, String history, String title,
			String sns, String category, String ftf, String loc, String price, String classtime, String formimg,
			String profile) {
		super();
		this.classcode = classcode;
		this.status = status;
		this.nickname = nickname;
		this.info = info;
		this.history = history;
		this.title = title;
		this.sns = sns;
		this.category = category;
		this.ftf = ftf;
		this.loc = loc;
		this.price = price;
		this.classtime = classtime;
		this.formimg = formimg;
		this.profile = profile;
	}
	public String getClasscode() {
		return classcode;
	}
	public void setClasscode(String classcode) {
		this.classcode = classcode;
	}
	public String getStatus() {
		return status;
	}
	public void setStatus(String status) {
		this.status = status;
	}
	public String getNickname() {
		return nickname;
	}
	public void setNickname(String nickname) {
		this.nickname = nickname;
	}
	public String getInfo() {
		return info;
	}
	public void setInfo(String info) {
		this.info = info;
	}
	public String getHistory() {
		return history;
	}
	public void setHistory(String history) {
		this.history = history;
	}
	public String getTitle() {
		return title;
	}
	public void setTitle(String title) {
		this.title = title;
	}
	public String getSns() {
		return sns;
	}
	public void setSns(String sns) {
		this.sns = sns;
	}
	public String getCategory() {
		return category;
	}
	public void setCategory(String category) {
		this.category = category;
	}
	public String getFtf() {
		return ftf;
	}
	public void setFtf(String ftf) {
		this.ftf = ftf;
	}
	public String getLoc() {
		return loc;
	}
	public void setLoc(String loc) {
		this.loc = loc;
	}
	public String getPrice() {
		return price;
	}
	public void setPrice(String price) {
		this.price = price;
	}
	public String getClasstime() {
		return classtime;
	}
	public void setClasstime(String classtime) {
		this.classtime = classtime;
	}
	public String getFormimg() {
		return formimg;
	}
	public void setFormimg(String formimg) {
		this.formimg = formimg;
	}
	public String getProfile() {
		return profile;
	}
	public void setProfile(String profile) {
		this.profile = profile;
	}
	
}
